import React from 'react';

const HeaderSection = () => {
    return(

            <header>
                <div className='announcemnts'></div>
                <nav>
                    <div className='logo'>
                        {/* <img src=""></img> <span>SaaS</span> */}
                    </div>
                    <ul className='navilink'>
                        <li className='navitem'>   Product </li>
                        <li className='navitem'>   Solutions </li>

                        <li className='navitem'>   Partners </li>

                        <li className='navitem'>   News </li>
                        <li className='navitem'>   Support </li>
                        <li className='navitem'>   Training </li>

                    </ul>
                    <ul className='utilities'>
                        <li className='navitem'>   Search</li>
                        <li className='navitem'>   Login </li>
                    </ul>
                </nav>
            </header>


    );
};

export default HeaderSection;
